import { Link } from 'react-router-dom'; 

const Dashboard = () => {
  return (
    <div>
      <h2>Dashboard</h2>
      
      <Link to="/add-book">
        <button>Add Book</button>
      </Link>
    </div>
  );
};

export default Dashboard;
